import { useState } from "react";
import Card from "../Components/card.jsx";

const Experiments=()=>{
    const [inOut, setInOut] = useState(true);
    var ListOfExperiment = ["VI Characteristics of a Diode","Zener Diode-Voltage Regulator",
    "BJT Common Emitter Characteristics",
    "BJT Common Base Characteristics"];
    return(
        <div>
            {inOut ? 
                <div className="expList">
                    {
                    ListOfExperiment.map((number) =>(
                    <Card data={number} setInOut={setInOut}/>
                    ))}
                </div>
                :
                <div>
                    http://ec2-18-191-175-183.us-east-2.compute.amazonaws.com:
                    hello
                    <form name='form1' method="get" action="http://localhost:5000/req_data">
                        <table>
                            <tr>
                                <td>Voltage</td>
                                <td><input type="text" name="Voltage"/></td>
                            </tr>
                            <tr>
                                <td align="center">
                                    <input type="submit" name='btnsubmit' value="Show Value"/>
                                </td>
                            </tr>
                        </table>
                    </form>
                </div>
            }
        </div>
    );
}

export default Experiments;
